import * as api from "../api/classes";

export function fetchClassesNames() {
  return async (dispatch) => {
    const result = await api.getClassesNames();
    return result;
  };
}

export function newClass(data) {
  return async (dispatch) => {
    try {
      await api.newClass(data);
    } catch (error) {}
  };
}
